import React from "react";
import produtos from '../../data/produtos'

    function produtosLI() {
        return (
            <div className="Tabela">
                <table>
                    <tr>
                        <th>Id</th>
                        <th>Nome</th>
                        <th>Preco</th>
                    </tr>
                    {produto.map((produto, key) => {
                        return (
                            <tr key={key}>
                                <td>{produto.id}</td>
                                <td>{produto.nome}</td>
                                <td>{produto.preco}</td>
                            </tr>
                        )
                    })}
                </table>
            </div>
        );
    }

export default produtosLI;
